import './Banner.css';

const Banner = () => {
    return (
        <div className="banner">
            <img src={require('../../assets/images/one1.jpg')} alt="banner" className="banner-image" />
            <div className="banner-content">
                <h1>Travel Uttarakhand</h1>
                <p>
                    description
                </p>
            </div>
        </div>
    );
};

export default Banner;
